using namespace std;

bool getFileContent(const std::string &fileName, std::vector<std::string> &vecOfStrs)
{
		std::ifstream in(fileName.c_str());
		std::string str;
		while (std::getline(in, str)) {
				if (!str.empty())
						vecOfStrs.push_back(str);
		}
		in.close();
		return true;
}

struct Edge
{
	int source, dest, weight;
};

struct Node
{
	int vertex, weight;
};

class Graph
{
public:
	vector<vector<Edge>> adjList;

	Graph(vector<Edge> const &edges, int n)
	{

			adjList.resize(n);

			for (Edge const &edge: edges) {

					adjList[edge.source].push_back(edge);
			}
	}
};

struct comp
{
	bool operator()(const Node &lhs, const Node &rhs) const
	{
			return lhs.weight > rhs.weight;
	}
};

void printPath(vector<int> const &prev, int i, int source)
{
		if (i < 0) {
				return;
		}
		printPath(prev, prev[i], source);
		if (i != source) {
				cout << ", ";
		}
		cout << i;
}

int findShortestPath(Graph const &graph, int source, int dest, int n)
{
		priority_queue<Node, vector<Node>, comp> min_heap;
		min_heap.push({source, 0});

		vector<int> dist(n, INT_MAX);
		dist[source] = 0;
		vector<bool> done(n, false);
		done[source] = true;
		vector<int> prev(n, -1);

		while (!min_heap.empty()) {
				Node node = min_heap.top();
				min_heap.pop();

				int u = node.vertex;

				for (auto i: graph.adjList[u]) {
						int v = i.dest;
						int weight = i.weight;

						if (!done[v] && (dist[u] + weight) < dist[v]) {
								dist[v] = dist[u] + weight;
								prev[v] = u;
								min_heap.push({v, dist[v]});
						}
				}
				done[u] = true;
		}

		for (int i = 0; i < n; i++) {
				if (i != source && dist[i] != INT_MAX && i == dest) {
						return dist[i] - graph.adjList.at(0).at(0).weight + graph.adjList.back().at(0).weight;
				}
		}
		return -1;
}

vector<Edge> a2(int l, string s)
{
		vector<Edge> in;
		in.reserve(s.length() * 4);

		for (int i = 0; i < s.length(); i++) {
				if (i % l != l - 1) {
						in.push_back({i, i + 1, stoi(string(1, s.at(i)))});
				}
				if (i % l != 0) {
						in.push_back({i, i - 1, stoi(string(1, s.at(i)))});
				}
				if ((int) i / l != 0) {
						in.push_back({i, i - l, stoi(string(1, s.at(i)))});
				}
				if ((int) i / l != l - 1) {
						in.push_back({i, i + l, stoi(string(1, s.at(i)))});
				}
		}
		return in;
}

